import React, { Component } from "react";

class TestClass extends Component {
      state = {
          count: 1
      };

      render() {
            return (
                  <>
                        <span> {this.formatCount()} </span>
                        <button> Increment </button>
                  </>
            );
      }

      formatCount() {
          if (this.state.count === 0) {
              return (<h1> Zero" </h1>);
          } else {
              return this.state.count;
          }
      }
}

export default TestClass;
